import logo from "./logo.svg";
import "./App.css";
import MFE from "./MFE";

function App() {
  return (
    <div className="App">
      <MFE />
      <ol
        style={{
          textAlign: "left",
          margin: "auto",
          width: "70%",
          padding: "1rem",
        }}
      >
        <li>npm i react-app-rewired</li>
        <li>add config-overrides.js to main dir (one with package.json)</li>
        <li>
          use rewire in start script -> "start": "PORT=4000 react-app-rewired
          start"
        </li>
      </ol>
    </div>
  );
}

export default App;
